DROP TABLE IF EXISTS `sys_account`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `sys_account` (
  `account_id` varchar(20) NOT NULL COMMENT '表ID',
  `account` varchar(30) DEFAULT NULL COMMENT '公司账号',
  `name` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '公司名称',
